INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 62, -416.5, "カリン", 1, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, 3.414, "2025/01/31 12:00:00", 1000001, 190801, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 62, -416.5, "カリン", 1, "ミッションをクリアして、\n報酬をゲットしましょう！", 2, 3.099, "2025/01/31 12:00:00", 1000002, 190801, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 63, -416.5, "カリン", 1, "受け取ることができる\n報酬があるようです\n確認してみてください", 3, 2.801, "2025/01/31 12:00:00", 1000003, 190801, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 63, -416.5, "カリン", 1, "報酬がもらえますよ！\nチェックしてみてください", 4, 0.0, "2025/01/31 12:00:00", 1000004, 190801, 2, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 64, -363.0, "カリン", 1, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 5, 2.12, "2025/01/31 12:00:00", 1000005, 190801, 2, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 64, -363.0, "カリン", 1, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 6, 1.68, "2025/01/31 12:00:00", 1000006, 190801, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 64, -363.0, "カリン", 1, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 7, 2.33, "2025/01/31 12:00:00", 1000007, 190801, 2, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", -6.0, 61, -285.0, "ラビリスタ", 10201, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 101, 5.18, "2025/01/31 12:00:00", 1020101, 133701, 3, 7);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", -2.0, 61, -285.0, "クリスティーナ", 10201, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 201, 8.77, "2025/01/31 12:00:00", 1020102, 133901, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "ネネカ", 10201, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 301, 15.5, "2025/01/31 12:00:00", 1020103, 133801, 6, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "ランファ", 10202, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 101, 9.061, "2025/02/28 12:00:00", 1020201, 134301, 2, 5);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "チカ", 10202, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 201, 7.699, "2025/02/28 12:00:00", 1020202, 134401, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "アオイ", 10203, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 101, 8.595, "2025/03/31 12:00:00", 1020301, 134601, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "クローチェ", 10203, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 201, 7.758, "2025/03/31 12:00:00", 1020302, 134501, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "ルイズマリー", 10204, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 101, 7.0, "2025/04/30 12:00:00", 1020401, 132302, 2, 6);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "イロハ", 10204, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 201, 7.904, "2025/04/30 12:00:00", 1020402, 132402, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "ソノ", 10204, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 301, 8.487, "2025/04/30 12:00:00", 1020403, 132502, 4, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "カノン", 10205, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 101, 8.763, "2025/05/31 12:00:00", 1020502, 134901, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "ツムギ", 10205, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 201, 6.417, "2025/05/31 12:00:00", 1020503, 134801, 1, 3);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "エリス", 10206, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 101, 10.335, "2025/06/30 12:00:00", 1020601, 135001, 3, 7);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "シェフィ", 10206, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 201, 6.281, "2025/06/30 12:00:00", 1020602, 135101, 2, 4);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "プレシア", 10206, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 301, 12.244, "2025/06/30 12:00:00", 1020603, 135201, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "クリア", 10207, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 101, 6.339, "2025/07/31 12:00:00", 1020701, 135301, 2, 8);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "アネモネ", 10207, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 201, 8.184, "2025/07/31 12:00:00", 1020702, 135401, 7, 9);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "アイラ", 10208, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 101, 3.906, "2025/08/31 12:00:00", 1020801, 129101, 9, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "シナツ", 10208, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 201, 14.465, "2025/08/31 12:00:00", 1020802, 129201, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "ヒヨリ", 10208, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 301, 8.662, "2025/08/31 12:00:00", 1020803, 100101, 4, 3);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "レイ", 10208, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 401, 10.915, "2025/08/31 12:00:00", 1020804, 100301, 1, 3);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "ユキノ", 10209, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 101, 6.042, "2025/09/30 12:00:00", 1020901, 135802, 1, 7);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "サツキ", 10209, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 201, 9.402, "2025/09/30 12:00:00", 1020902, 135903, 4, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2030/01/01 14:59:59", 0.0, 61, -285.0, "ルルィ", 10209, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 301, 8.16, "2025/09/30 12:00:00", 1020903, 136902, 8, 1);
